    # initialize a dictionary to store the count of each word
    word_count = {}

    # loop through each word in the input dictionary
    for word in words:
        # increment the count of the word if it is already in the dictionary
        if word in word_count:
            word_count[word] += 1
        # initialize the count of the word to 1 if it is not in the dictionary
        else:
            word_count[word] = 1

    # initialize a list to store the most common words
    most_common = []

    # loop through the dictionary and find the words with the highest count
    for word, count in word_count.items():
        if len(most_common) < 5:
            # add the word to the list if it is one of the top 5 most common
