def rearange_string(S):
    # count the frequency of each character in the string
    char_freq = {}
    for char in S:
        if char in char_freq:
            char_freq[char] += 1
        else:
            char_freq[char] = 1

    # create a max heap to store characters based on their frequency
    heap = [(-freq, char) for char, freq in char_freq.items()]
    heapq.heapify(heap)

    # initialize previous character and result string
    prev_char = None
    result = ''

    # rearrange the string by selecting the character with highest frequency that is different from the previous character
    while heap:
        freq, char = heapq.heappop(heap)
        if prev_char and char == prev_char:
            if not heap:
                return "Not possible"
            next_freq, next_char = heapq.heappop(heap)
            result += next_char
            if next_freq + 1 < 0:
                heapq.heappush(heap, (next_freq + 1, next_char))
            heapq.heappush(heap, (freq, char))
        else:
            result += char
            if freq + 1 < 0:
                heapq.heappush(heap, (freq + 1, char))
        prev_char = char

    return result

