def magic_square_test(my_matrix):
    # Check if the matrix is square
    if len(my_matrix) != len(my_matrix[0]):
        return False

    # Calculate the magic number for the magic square
    n = len(my_matrix)
    magic_num = n * (n ** 2 + 1) // 2

    # Check rows and columns sum to magic number
    for i in range(n):
        if sum(my_matrix[i]) != magic_num:
            return False
        if sum([my_matrix[j][i] for j in range(n)]) != magic_num:
            return False

    # Check diagonals sum to magic number
    if sum([my_matrix[i][i] for i in range(n)]) != magic_num:
        return False
    if sum([my_matrix[i][n-i-1] for i in range(n)]) != magic_num:
        return False

    return True

