def find_x_y(a, b, n):
    # calculate gcd(a, b)
    def gcd(a, b):
        if b == 0:
            return a
        return gcd(b, a % b)

    g = gcd(a, b)

    if n % g != 0:
        return None

    # find x0, y0 such that ax0 + by0 = g
    def extended_gcd(a, b):
        if b == 0:
            return (a, 1, 0)
        else:
            d, x, y = extended_gcd(b, a % b)
            return (d, y, x - (a // b) * y)

    d, x0, y0 = extended_gcd(a, b)

    # solutions for ax + by = n are x = x0 * (n/g) + k(b/g), y = y0 * (n/g) - k(a/g)
    x = x0 * (n // g)
    y = y0 * (n // g)

    return x, y

