def longest_common_subsequence(X, Y, m, n):
    # create a 2D array to store the lengths of longest common subsequences
    lcs = [[0] * (n + 1) for _ in range(m + 1)]

    # compute the length of longest common subsequence using dynamic programming
    for i in range(m + 1):
        for j in range(n + 1):
            if i == 0 or j == 0:
                lcs[i][j] = 0
            elif X[i - 1] == Y[j - 1]:
                lcs[i][j] = lcs[i - 1][j - 1] + 1
            else:
                lcs[i][j] = max(lcs[i - 1][j], lcs[i][j - 1])

    # backtrack to find the actual longest common subsequence
    lcs_length = lcs[m][n]
    lcs_sequence = [''] * lcs_length
    i, j = m, n
    while i > 0 and j > 0:
        if X[i - 1] == Y[j - 1]:
            lcs_sequence[lcs_length - 1] = X[i - 1]
            i -= 1
            j -= 1
            lcs_length -= 1
        elif lcs[i - 1][j] > lcs[i][j - 1]:
            i -= 1
        else:
            j -= 1

    return ''.join(lcs_sequence)

