def max_sum(arr, n):
    # Initialize variables to store the maximum increasing and decreasing sub-sequences
    inc = [0]*n
    dec = [0]*n

    # Initialize the first element of the increasing sub-sequence to be the same as the array element
    inc[0] = arr[0]

    # Calculate the increasing sub-sequence
    for i in range(1, n):
        for j in range(i):
            if arr[i] > arr[j] and inc[i] < inc[j] + arr[i]:
                inc[i] = inc[j] + arr[i]

    # Initialize the last element of the decreasing sub-sequence to be the same as the array element
    dec[n-1] = arr[n-1]

    # Calculate the decreasing sub-sequence
    for i in range(n-2, -1, -1):
        for j in range(n-1, i, -1):
            if arr[i] > arr[j] and dec[i] < dec[j] + arr[i]:
                dec[i] = dec[j] + arr[i]

    # Find the maximum bi-tonic sub-sequence sum
    max_sum = 0
    for i in range(n):
        max_sum = max(max_sum, inc[i] + dec[i] - arr[i])

    return max_sum

