def ncr_modp(n, r, p):
    # Initialize variables to store factorial values
    fact = [1] * (n + 1) # create an array to store factorials

    # Calculate factorials for all numbers up to n
    for i in range(1, n + 1):
        fact[i] = fact[i - 1] * i % p

    # Calculate the value of nCr % p using factorials
    def mod_inverse(a, p):
        return pow(a, p - 2, p)

    def ncr(n, r, p, fact):
        return (fact[n] * mod_inverse((fact[r] * fact[n - r]) % p, p)) % p

    return ncr(n, r, p, fact)

