def maxAverageOfPath(cost, N):
    //initialize variables to store the maximum average and the path with the maximum average
    max_average = 0
    max_path = []

    //function to find all possible paths starting from a given position (i, j) in the matrix
    def findPath(i, j, path, total, count):
        //update the total cost and count of elements visited
        total += cost[i][j]
        count += 1
        //add the current position to the path
        path.append((i, j))
        //if reached the bottom-right corner of the matrix, calculate the average
        if i == N-1 and j == N-1:
            average = total / count
            //if the current average is greater than the maximum average, update the maximum average and path
            if average > max_average:
                max_average = average
                max_path = path[:]
        else:
            //explore the right and bottom directions if within bounds
            if j+1 < N:
                findPath(i, j+1, path[:], total, count)
            if i+1 < N:
                findPath(i+1, j, path[:], total, count)

    //start the search from the top-left corner of the matrix
    findPath(0, 0, [], 0, 0)

    return max_path

